import React, { useEffect, useState } from "react";

const TestZillowApi = () => {
  const [data, setData] = useState([]);
  const apiKey = "ce424b08dfmsh723f4c57800adb0p134ee8jsn0fa8554b8f0f";
  const apiUrl = "zillow56.p.rapidapi.com";
  const [loading, setLoading] = useState(true); // Add loading state

  useEffect(() => {
    setLoading(true); // Set loading state before the fetch
    fetch(apiUrl, {
      headers: {
        "X-RapidAPI-Key": apiKey,
      },
    })
      .then((response) => response.json()) // Convert response to JSON
      .then((resultData) => {
        setData(resultData);
        setLoading(false);
        console.log(resultData); // Log the data
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setLoading(false);
      });
  }, []); // Empty dependency array to run the effect once

  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : data.length > 0 ? (
        data.map((item) => (
          <div key={item.zpid} className="property-card">
            <img src={item.imgSrc} alt="Property" className="property-image" />
            <div className="property-details">
              <p>
                Address: {item.streetAddress} {item.unit}
              </p>
              <p>
                City: {item.city}, {item.state} {item.zipcode}
              </p>
              <p>Bedrooms: {item.bedrooms}</p>
              <p>Bathrooms: {item.bathrooms}</p>
              <p>Price: ${item.price.toLocaleString()}</p>
              <p>Home Type: {item.homeType}</p>
              <p>Home Status: {item.homeStatus}</p>
            </div>
          </div>
        ))
      ) : (
        <p>No data available.</p>
      )}
    </div>
  );
};

export default TestZillowApi;
